import React from 'react';
import TextArea from './field/textarea';

const Question1 = (props) => {
  return (
    <div>
      <h1 className="question">Question 1</h1>
      <p>Describe your life Vision. In one sentence, describe your ideal life 5 years from now.</p>
      <TextArea
        id="vision"
        type="text"
        label="Your Vision:"
        value={props.data.my_vision.vision}
        onChange={props.onChange}
      />
    </div>
  );
}

export default Question1;
